import React, { useState } from 'react';
import { ChevronLeft, Eye } from 'lucide-react';

// This is a placeholder component for the "Account Level" page
const AccountLevelPage = ({ sbuTitle, onBack }) => (
  <div className="p-8">
    <button onClick={onBack} className="flex items-center text-gray-700 hover:text-gray-900 transition-colors duration-300 mb-8">
      <ChevronLeft className="h-5 w-5 mr-2" />
      Back
    </button>
    <h1 className="text-3xl md:text-4xl font-bold text-gray-800 mb-4">
      Account Level for {sbuTitle}
    </h1>
    <p className="text-gray-600">
      This is a placeholder page. You would add the account-level details here.
    </p>
  </div>
);

// This is the main SBU selection component
const App = () => {
  // Use state to manage which view is currently displayed
  const [view, setView] = useState('sbu-level');
  // Use state to store the title of the SBU to pass to the AccountLevelPage
  const [selectedSbuTitle, setSelectedSbuTitle] = useState('');

  // Define the list of Strategic Business Units (SBUs)
  const sbus = [
    { id: 1, title: 'Banks 1', revenue: '$1,500,000.00' },
    { id: 2, title: 'Banks 2', revenue: '$1,200,000.00' },
    { id: 3, title: 'Cap Mts - Buy Side', revenue: '$800,000.00' },
    { id: 4, title: 'Cap Mts - Sell Side and Mkt Infra', revenue: '$2,000,000.00' },
    { id: 5, title: 'JPMC', revenue: '$1,800,000.00' },
    { id: 6, title: 'LATIN AMERICA', revenue: '$500,000.00' },
  ];

  // Function to handle the "View" button click
  const handleViewClick = (sbuTitle) => {
    setSelectedSbuTitle(sbuTitle);
    setView('account-level');
  };

  // Function to handle the "Back" button click on the account page
  const handleBackClick = () => {
    setView('sbu-level');
    setSelectedSbuTitle('');
  };

  // Conditional rendering based on the current view state
  if (view === 'account-level') {
    return <AccountLevelPage sbuTitle={selectedSbuTitle} onBack={handleBackClick} />;
  }

  // Render the SBU selection table
  return (
    <div className="min-h-screen bg-gray-100 p-8 font-sans antialiased">
      <div className="max-w-4xl mx-auto">
        
        {/* Back button is now outside of the conditional render since it's only on the account page */}
        {/* Title */}
        <h1 className="text-3xl md:text-4xl font-bold text-gray-800 mb-10">
          Select Strategic Business Unit (SBU)
        </h1>

        {/* Responsive Table for SBU data */}
        <div className="bg-white rounded-2xl shadow-md overflow-x-auto">
          <table className="min-w-full divide-y divide-gray-200">
            <thead className="bg-gray-50">
              <tr>
                <th
                  scope="col"
                  className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider"
                >
                  Strategic Business Unit (SBU)
                </th>
                <th
                  scope="col"
                  className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider"
                >
                  Revenue
                </th>
                <th
                  scope="col"
                  className="px-6 py-3 text-right text-xs font-medium text-gray-500 uppercase tracking-wider"
                >
                  View
                </th>
              </tr>
            </thead>
            <tbody className="bg-white divide-y divide-gray-200">
              {sbus.map((sbu) => (
                <tr key={sbu.id} className="hover:bg-gray-50 transition-colors duration-200">
                  <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-blue-600">
                    {sbu.title}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                    {sbu.revenue}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-right text-sm font-medium">
                    <button
                      onClick={() => handleViewClick(sbu.title)}
                      className="inline-flex items-center p-2 rounded-full bg-blue-50 hover:bg-blue-100 text-blue-600 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500 transition-colors duration-200"
                    >
                      <Eye className="h-5 w-5" />
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default App;
